    <div >
    
          <h1>Description</h1>
          <p> {list.description}</p>
         
     <span>
     <Iframe src={list.trailer} allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullscreen/>
     </span>
    </div>


  )
}

